import React from "react";
import styled from "styled-components";
import "./index.css";
import { FaUser, FaShoppingCart } from "react-icons/fa";

const Header = styled.div``;

const LogoNav = styled.nav`
    display: flex;
    justify-
  align-items: center;
  height: 77px;
  background-color: #f6f7fc;
  box-shadow: 0px -1px 5px grey;
`;

const Logo = styled.img`
  width: 220px;
  display: flex;
  justify-content: flex-start;
`;

const Nav = styled.nav``;

const DropButton = styled.button``;

const Dropdown = styled.button``;

const IndexComponent = () => {
  return (
    <>
      {/* write html tag as plain tag */}
      {/* &lt;h1&gt;hjhgkjhgk&lt;/h1&gt; */}
        <Header>
            <LogoNav>

                <Logo src="/images/materiallibrarylogo.png" alt="mlLogo"></Logo>
                <div className="drpdown">
                    <span className="dropbtn">Portfolios</span>
                    <ul className="dropdown-content">
                        <li>Create a Portfolio</li>
                        <li>Company/Studio</li>
                        <li>Student/Professionls</li>
                        <li>Brand</li>
                        <li>College</li>

                    </ul>
                

                {/* <div className="dropdown"> */}
                    <span className="dropbtn">Tutorials</span>
                    <ul className="dropdown-content">
                        <li>Videos</li>
                        <li>Blogs</li>
                    </ul>
                {/* </div> */}
                {/* <div class="dropdown"> */}
                    <span class="dropbtn">Jobs</span>
                    <ul class="dropdown-content">
                        <li>Apply for </li>
                        <li>Link 2</li>
                        
                    </ul>
                </div>
            </LogoNav>
            <Nav>
                <p>jitesh</p>
            </Nav>
      </Header>
    </>
  );
};

export default IndexComponent;
